import React from "react";
import FormModal from "./FormModal";

import zebraLogo from "../assets/images/zebra-logo.png"

import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBCollapse
} from 'mdb-react-ui-kit';

export default function ZNavbar()
{

  //alert('Nav-No: ' + Math.random(1000));
  
  const showModal = React.useRef(false);
  const formModalKey = React.useRef(1);
  const [refresh, setRefresh] = React.useState(false);

  const handleShow= (e) =>{
    e && e.preventDefault();
    
    showModal.current = true;
    //alert("ShowModel::" + showModal.current);
    setRefresh(!refresh);
    
  }

  formModalKey.current = formModalKey.current + 1;

  return (
  <>
      <MDBNavbar expand='lg' light bgColor='light'>
      <MDBContainer fluid>
        <MDBNavbarBrand href='#'>
          <img
            src={zebraLogo}
            height='30'
            alt=''
            loading='lazy'
          />
          ZEBRA.AI
        </MDBNavbarBrand>
        <MDBCollapse navbar>
          <MDBNavbarNav>
            <MDBNavbarItem>
              <MDBNavbarLink active aria-current='page' href='#'>
                Home
              </MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink href='#'>Features</MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink href='#'>Pricing</MDBNavbarLink>
            </MDBNavbarItem>
            <MDBNavbarItem>
              <MDBNavbarLink disabled href='#' tabIndex={-1} aria-disabled='true'>
                Disabled
              </MDBNavbarLink>
            </MDBNavbarItem>
          </MDBNavbarNav>
        </MDBCollapse>
      </MDBContainer>
    </MDBNavbar>

    {showModal.current && <FormModal showModal={true} key={formModalKey.current}></FormModal>}
  </>
  );

}
